Count 2 - Maintain drug trafficking place - Guilty plea.  Convicted.  State moves to dismiss and read in count 1, PTC deliver schedule I, II narcotics; count 3, deliver prescription drug; and count 4, maintain drug trafficking place.  Motion granted.  Sentence is withheld.  Defendant is placed on probation to DOC for two (2) years.  Conditions of probation are:
1) AODA assessment and follow through;
2) Submit to random urine screens and pay for same;
3) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
4) Maintain full-time employment/schooling;
5) Pay $300.00 restitution to Metro Drug Unit;
6) Pay costs of action;
7) Pay supervision fees in an amount to be determined by DOC;
8) Provide DNA sample;
9) Forty-five (45) days jail, Fifteen (15) days up front, under the Huber Law, to commence on 01-27-15 by 6:00 p.m.  Thirty (30) days, stayed, to be imposed upon the discretion of the agent.  
Plea Questionnaire/Waiver of Rights. 
Notice of Right to Seek Postconviction Relief. 
Ineligible Voting Notice & Acknowledgment.  
